{
    "categoryId": "80684d3c-34f8-4f3d-b819-60dd4c9a9111",
    "description": "Chocolade dessert",
    "forAmount": 6,
    "forUnit": "Personen",
    "ingredients": [
        {
            "amount": 2.00,
            "name": "Eieren",
            "sortOrder": 1,
            "id": "87c2ec57-0329-6a70-62d7-39fef8371367"
        },
        {
            "amount": 1.00,
            "name": "Eidooier",
            "sortOrder": 2,
            "id": "ed73163f-0bdc-0fbb-120b-39fef8371367"
        },
        {
            "amount": 125.00,
            "name": "Boter",
            "sortOrder": 3,
            "unit": "gram",
            "id": "f252b5b3-c070-77d2-fe11-39fef8371367"
        },
        {
            "amount": 125.00,
            "name": "Fondantchocolade",
            "sortOrder": 4,
            "unit": "gram",
            "id": "c2441f98-2149-00c7-3977-39fef8371367"
        },
        {
            "amount": 60.00,
            "name": "Griessuiker",
            "sortOrder": 5,
            "unit": "gram",
            "id": "72691fd7-ee7d-a150-2277-39fef8371367"
        },
        {
            "amount": 25.00,
            "name": "Patisseriebloem",
            "sortOrder": 6,
            "unit": "gram",
            "id": "07faccb5-4d39-e23c-e2fe-39fef8371367"
        }
    ],
    "name": "Moelleux",
    "steps": [
        {
            "instructions": "Verwarm de oven voor op 190 C.",
            "number": 1,
            "id": "69bd9dac-6a53-c268-88b2-39fef8371367"
        },
        {
            "instructions": "Klop de eieren en de dooier met de suiker tot het mengsel als een lint van de klopper afloopt (met de hand zo'n 10 minuten, met de mixer op hoogste stand 5 minuten).",
            "number": 2,
            "id": "9e6398f5-724f-04fe-8443-39fef8371368"
        },
        {
            "instructions": "Laat de chocolade en de boter smelten in een warmwaterbad of in de magnetron. Roer goed glad. Schenk er de helft van het eimengsel bij. Roer glad.",
            "number": 3,
            "id": "0cc45768-c245-fe9e-6678-39fef8371368"
        },
        {
            "instructions": "Voeg het chocolademengsel aan de rest van het eimengsel toe. Meng voorzichtig. Strooi er de gezeefde bloem bij. Spatel luchtig om en om tot de bloem volledig opgenomen is.",
            "number": 4,
            "id": "d1cc836b-13da-0b61-8630-39fef8371368"
        },
        {
            "instructions": "Vet de 6 ovenschaaltjes goed in en bestuif ze met bloem. Verdeel het chocolademengsel over de schaaltjes.",
            "number": 5,
            "id": "945d5701-99b7-849f-7028-39fef8371368"
        },
        {
            "instructions": "Bak 8 minuten in het midden van de oven. Serveer meteen.",
            "number": 6,
            "id": "4aa988ce-04e2-1e4b-919f-39fef8371368"
        },
        {
            "instructions": "Eet smakelijk!",
            "number": 7
        }
    ]
}

